e the vehicle faster than its rivals,[41] prototypes of the vehicle were seen testing on the Nürburgring in June 2008.[42] On 17 December 2008, Fukui announced during a speech about Honda\'s revised financial forecast that, due to poor economic conditions, all plans for a next-generation NSX had been cancelled.[43] In March 2010, the Acura NSX project changed name to Honda HSV-010 GT and was entered in the Japanese SuperGT Championship. The HSV-010 GT is powered by a 3.4-liter V8 sending somewhere in excess of 500 hp (373 kW) through the sequential manual gearbox from Ricardo.','publish','open','open','','honda-nsx-2013','','','2015-07-03 11:39:26','2015-07-03 11:39:26','',0,'http://cardealerwp.wpengine.com/test/car/182/',0,'car','',0),(183,3,'2014-10-27 15:28:39','2014-10-27 15:28:39','','Lexus IS 2012','Based on the Japanese-market Toyota Altezza, the Lexus IS 300 was not originally designed to be a luxury car. When the automaker decided to sell a version of this compact, rear-drive sedan in the U.S., it was retrofitted with additional luxury content and a larger engine -- the 3.0-liter inline six-cylinder already used in the midsize Lexus GS 300 sedan.','publish','open','open','','lexus-is-2012','','','2015-07-03 11:45:58','2015-07-03 11:45:58','',0,'http://cardealerwp.wpengine.com/test/car/183/',0,'car','',0),(184,3,'2014-05-18 15:37:55','2014-05-18 15:37:55','','Lexus LFA 2014','The LF-NX is the ideal juxtaposition of human-centered design and distinct styling. Featuring intuitive touch-sensitive electrostatic switches, an aggressive signature spindle grille and an ergonomic interior, this compact SUV is more than a new type of crossover. It\'s a new way to cross boundaries.','publish','open','open','','lexus-lfa-2014','','','2015-07-03 11:47:00','2015-07-03 11:47:00','',0,'http://cardealerwp.wpengine.com/test/car/184/',0,'car','',0),(185,3,'2014-05-18 15:43:09','2014-05-18 15:43:09','','Mazda 2 2004','Ea urna ullamcorper? Recusandae voluptates a distinctio soc